INSERT INTO `wp_posts` VALUES("5", "1", "2016-03-05 13:37:59", "2016-03-05 13:37:59", "6Wunderkinder’s flagship product, Wunderlist, has been a massive hit since its inception. Arguably one of the best to manage your\r\ntasks in your business and personal life. What makes it different from any other app? Simplicity. You don’t need to fiddle around with\r\nso many unnecessary features like you would with traditional to-do apps. Soon as you open the app, Wunderlist dives right into your\r\ntasks and you can get to work.\r\n\r\n&nbsp;\r\n\r\n6Wunderkinder’s flagship product, Wunderlist, has been a massive hit since its inception. Arguably one of the best to manage your\r\ntasks in your business and personal life. What makes it different from any other app? Simplicity. You don’t need to fiddle around with\r\nso many unnecessary features like you would with traditional to-do apps. Soon as you open the app, Wunderlist dives right into your\r\ntasks and you can get to work.", "Our Favourite Task Management  App!", "6Wunderkinder’s flagship product, Wunderlist, has been a massive hit since its inception. Arguably one of the best to manage your\r\ntasks in your business and personal life. What makes it different from any other app? Simplicity. You don’t need to fiddle around with\r\nso many unnecessary features like you would with traditional to-do apps. Soon as you open the app, Wunderlist dives right into your\r\ntasks and you can get to work.", "publish", "open", "open", "", "our-favourite-task-management-app", "", "", "2016-03-06 13:51:15", "2016-03-06 13:51:15", "", "0", "http://classic/?p=5", "0", "post", "", "0");
