INSERT INTO `wp_posts` VALUES("60", "1", "2016-03-09 17:00:52", "2016-03-09 17:00:52", "It’s not always easy to filter out noise and purely focus on the content. Too many blogs and news sites are filled with colourful and distracting\r\nadvertisement left right and centre. This is where we do things differently! Rather than just focusing purely and generating revenue, we focus\r\non great user experience.\r\n\r\nYou will notice that our news articles are content focused and free of any distractions. On top of that, we deliver content revolving design on a\r\ndaily basis. Offering you insightful tutorials, techniques, design inspirations, mobile app development, coding, unique advertisements, and\r\nfreebies.\r\n\r\nOur focus is and forever will be to bring high quality resources to lean from and to be inspired. Visit us daily for new design related articles!", "What We Are All About", "", "trash", "closed", "closed", "", "what-we-are-all-about", "", "", "2016-03-09 17:01:49", "2016-03-09 17:01:49", "", "0", "http://classic/?post_type=team&#038;p=60", "0", "team", "", "0");
